4637.objetoCompra:
Contratação de Serviço de Telefonia Fixa Comutado (STFC) na modalidade DIGITRONCO de modo a atender a 01 (uma) linha telefônica vinculada ao tridígito 185, utilizado pela Marinha do Brasil nos serviços relacionados à Salvaguarda da Vida Humana no Mar, sob a designação de “MARINHA – EMERGÊNCIAS MARÍTIMAS E FLUVIAIS”. Serviço de Telecomunicações – de dados - DIGITRONCO que substituirá a linha analógica (91) 3224-3079 que atende hoje o TRIDÍGITO 185 (Salvamar Norte).
Especificação técnica do Serviço
           De acordo com a Resolução Nº 749/2022 da ANATEL, as chamadas destinadas aos números de utilidade pública de emergência não são tarifadas. Desse modo, deve ser considerado na composição dos custos da proposta o valor referente à assinatura/manutenção do serviço;
           A Contratada deverá ser legalmente autorizada e regulamentada junto à ANATEL;
           A TECNOLOGIA de entrega deve considerar o digitronco TDM, que representa uma solução de acesso a RTPC que possibilita o estabelecimento de várias ligações simultâneas, por intermédio de circuitos digitais de 4 Mbps, trazendo economia e agilidade. 
           Deve-se considerar a implementação do Tridígito, que é um serviço especial de acesso telefônico destinado exclusivamente ao atendimento de serviços públicos de emergência e de utilidade pública. O Tridígito é o 185 (cento e oitenta e cinco), conforme Ato 881 de 18 de fevereiro de 2008 da ANATEL na área SALVAMAR NORTE. 
           O serviço deverá considerar a linha de tronco chave associada ao tridígito 185;
           O serviço tridígito deverá possuir a funcionalidade de identificação do número que realizou a chamada;
           Condições de execução
           O serviço objeto dessa contratação deverá ser prestado 24 (vinte e quatro)  horas por dia, 7 (sete) dias por semana, durante todo o período de vigência do contrato.
